pragma solidity >=0.7.0 <0.9.0;




interface IECR20 {
    // 返回代币总供给.
    function totalSupply() external view returns (uint256);
    //返回账户`account`所持有的代币数.
    function balanceOf(address account) external view returns (uint256);
    // 转账 `amount` 单位代币，从调用者账户到另一账户 `to`.
    // 如果成功，返回 `true`.
    // 释放 {Transfer} 事件.
    function transfer(address to, uint256 amount) external returns (bool);
    // 返回`owner`账户授权给`spender`账户的额度，默认为0。
    // 当{approve} 或 {transferFrom} 被调用时，`allowance`会改变.
    function allowance(address owner, address spender) external view returns (uint256);
    // 调用者账户给`spender`账户授权 `amount`数量代币。
    // 如果成功，返回 `true`.
    // 释放 {Approval} 事件.
    function approve(address spender, uint256 amount) external returns (bool);
    // 通过授权机制，从`from`账户向`to`账户转账`amount`数量代币。转账的部分会从调用者的`allowance`中扣除。
    // 如果成功，返回 `true`.
    // 释放 {Transfer} 事件.
    function transferFrom(address from,address to,uint256 amount) external returns (bool);
    //释放条件：当 `value` 单位的货币从账户 (`from`) 转账到另一账户 (`to`)时.
    event Transfer(address indexed from, address indexed to, uint256 value);
    //释放条件：当 `value` 单位的货币从账户 (`owner`) 授权给另一账户 (`spender`)时.
    event Approval(address indexed owner, address indexed spender, uint256 value);

}


contract ERC20 is IECR20{

    mapping(address => uint256) public override balanceOf;

    mapping(address => mapping(address => uint256)) public override allowance;

    uint256 public override totalSupply;   // 代币总供给

    string public name;   // 名称
    string public symbol;  // 代号
    
    uint8 public decimals = 18; // 小数位数

    constructor(string memory name_, string memory symbol_){
        name = name_;
        symbol = symbol_;
    }

    // transfer()函数：实现IERC20中的transfer函数，代币转账逻辑
    // 调用方扣除amount数量代币，接收方增加相应代币。
    function transfer(address recipient, uint amount) external override returns (bool) {
        balanceOf[msg.sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }
    // approve()函数：实现IERC20中的approve函数，代币授权逻辑。
    // 被授权方spender可以支配授权方的amount数量的代币。spender可以是EOA账户，也可以是合约账户
    function approve(address spender, uint amount) external override returns (bool) {
        allowance[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }
    // transferFrom()函数：实现IERC20中的transferFrom函数，授权转账逻辑
    // 被授权方将授权方sender的amount数量的代币转账给接收方recipient
    function transferFrom(
        address sender,
        address recipient,
        uint amount
    ) external override returns (bool) {
        allowance[sender][msg.sender] -= amount;
        balanceOf[sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(sender, recipient, amount);
        return true;
    }

}

